import React, { useState } from 'react';
import { Box, CssBaseline } from '@mui/material';
import CollapsibleSidebar from '../SideBar/SideBar'; // Adjust the import path as necessary
import CustomAppBar from '../AppBar/AppBar'; // Adjust the import path as necessary

const MainLayout = () => {
    const [sidebarOpen, setSidebarOpen] = useState(true);

    const handleSidebarToggle = () => {
        setSidebarOpen(!sidebarOpen);
    };

    return (
        <Box sx={{ display: 'flex', height: '100vh', width: '100vw' }}>
            <CssBaseline />
            <CustomAppBar handleSidebarToggle={handleSidebarToggle} sidebarOpen={sidebarOpen} />
            <CollapsibleSidebar open={sidebarOpen} handleToggleDrawer={handleSidebarToggle} />
         
        </Box>
    );  
};

export default MainLayout;
